package basics;

public class Inc_Dec_operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub 
		int count=10;
		
		//post increment
		System.out.println(count++);
		//pre increment
		System.out.println(++count);
		
		int count1=15;
		
		//post decrement
		System.out.println(count1--);
		//pre decrement
		System.out.println(--count1);
	}

}
